import React from 'react';
import { Link } from 'react-scroll';

function Navigation() {
  const navStyle = {
    display: 'flex', // Make the list items flex containers
    listStyle: 'none', // Remove default list styles
    justifyContent: 'space-evenly', // Space the list items horizontally
    padding: '0', // Remove padding
  };

  const listItemStyle = {
    marginLeft: '0px', // Remove margin
    padding: '0',
    marginRight: '0px' // Remove padding
  };

  return (
    <nav className="horizontal-navigation">
      <ul style={navStyle}>
        <li style={listItemStyle}>
          <Link to="about" smooth={true} duration={500}>
            About
          </Link>
        </li>
        <li style={listItemStyle}>
          <Link to="projects" smooth={true} duration={500}>
            Projects
          </Link>
        </li>
        <li style={listItemStyle}>
          <Link to="contact" smooth={true} duration={500}>
            Contact
          </Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navigation;
